import React from 'react';
import Navbar from './Navbar.js';
import Product from './ProductCard.js';
import iphone from './resources/iphonex.png';
import logo from './logo.svg';
import nature from './ressources/nature.jpg';
import './style.css';

export default class Menu extends React.Component{
    render(){
        return(
            <div>
                
                <section id="facilities">
                <div class="container">
                <h1>facilites</h1>
              
                <div class="row">
                    <div class="col-md-4">
                        <div class="card text-center">
                            <img src="resources/nature.jpg" class="card-img-top"></img>
                            <div class="card-body">
                                <h5 class="card-title">Card Title</h5>
                                <p class="card-text">Some quick text here</p>
                            <a href="#">CHECK GYM</a>
                            </div>       
                        </div>
                    </div>
                    
                    
                  
                </div>
                </div>
                </section>
            </div>
            
        )
    }   
}
